import { useEffect, useState } from "react";

function Test() {
  const [result, setResult] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    (async () => {
      try {
        // 1) Fetch todos from external API
        const res1 = await fetch("https://jsonplaceholder.typicode.com/todos");
        if (!res1.ok) throw new Error("Failed to fetch todos");
        const todos = await res1.json();

        // 2) Send todos to Python backend
        const res2 = await fetch("http://localhost:5000/process", {
          method: "POST",
          headers: { "Content-Type": "application/json" },
          body: JSON.stringify({ todos }),
        });
        if (!res2.ok) throw new Error("Failed to reach backend");
        const data = await res2.json();

        setResult(data);
      } catch (err) {
        console.error("Error in Test:", err);
        setError(err.message);
      }
    })();
  }, []);

  return (
    <div>
      <h1>Completed Todos Count:</h1>
      {error && <p style={{ color: "red" }}>{error}</p>}
      <pre>{result ? JSON.stringify(result) : "Loading..."}</pre>
    </div>
  );
}

export default Test;
